import { Autocomplete, TextField, Avatar } from '@mui/material';
import { Person as PersonIcon } from '@mui/icons-material';

const options = [
    { label: 'Alice', value: 1, avatar: <Avatar><PersonIcon /></Avatar> },
    { label: 'Bob', value: 2, avatar: <Avatar><PersonIcon /></Avatar> },
    { label: 'Charlie', value: 3, avatar: <Avatar><PersonIcon /></Avatar> },
];

const CustomSelectDropdown = () => {
    const renderOption = (option) => (
        <React.Fragment>
            {option.avatar}
            {option.label}
        </React.Fragment>
    );

    return (
        <Autocomplete
            options={options}
            getOptionLabel={(option) => option.label}
            renderOption={renderOption}
            renderInput={(params) => (
                <TextField {...params} variant="outlined" placeholder="Search" />
            )}
        />
    );
};

export default CustomSelectDropdown;
